package exercise1;

public class PrintMatrix {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 1; i <= 10; i++) {
			if(i >= 1 && i <= 5) {
				System.out.print(i + " ");
			} 
			if(i == 5) {
				System.out.println();
			}
			if(i >= 6 && i <= 7) {
				System.out.print(i + " ");
			}
			if(i == 7) {
				System.out.println();
			}
			if( i >= 8) {
				System.out.print(i + " ");
			}
			
		}

	}

}
